ray-800 text-base leading-relaxed py-1\"><strong>Hola, Marco Castilla,</strong></p><p class=\"text-gray-800 text-base leading-relaxed py-1\">En el marco de nuestra campaña <strong>“UltraFibra 2025 – Conexión que Impulsa tu Hogar”</strong>, en <strong>TelcoFutura Perú</strong> queremos llevar tu experiencia digital al siguiente nivel con nuestros <strong>nuevos planes UltraFibra Hogar</strong>, diseñados para ofrecerte velocidad, estabilidad y una cobertura superior.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\"><strong>? Beneficios de nuestros nuevos planes UltraFibra</strong></p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Velocidades <strong>300, 600 y 900 Mbps</strong>.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Router <strong>WiFi 6 con cobertura ampliada</strong>.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\"><strong>Instalación sin costo</strong> para clientes actuales.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Atención prioritaria con nuestro equipo <strong>TechCare 24/7</strong>.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Descuentos exclusivos durante los primeros 3 meses.</p><h3 class=\"text-gray-900 font-bold mt-4 mb-2\"><strong>? ¿Por qué cambiar a UltraFibra?</strong></h3><p class=\"text-gray-800 text-base leading-relaxed py-1\">Tu hogar merece una conexión moderna que soporte videollamadas, gaming, clases virtuales, streaming en 4K y múltiples dispositivos conectados al mismo tiempo.<br>Con UltraFibra, podrás hacerlo sin interrupciones.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\"></p><p class=\"text-gray-800 text-base leading-relaxed py-1\"></p>','? Mejora tu plan ahora con UltraFibra','http://localhost:3000/encuesta/null','2025-12-04 18:32:31','2025-12-04 19:10:39'),(11,65,43,10,1,5,'Media','UltraFibra 2025 – Conexión que Impulsa tu Hogar	','Mejora tu net!','Internet','2025-12-04 19:18:00','2025-12-04 20:20:00','Renueva tu experiencia: nue