ción de marca enfocada en mejora constante. Requiere programar visita técnica o reconexión.','Incremento de valor gratuito para clientes actuales.','2025-12-05 22:55:00','2025-12-05 23:57:00','? ¡Obtén tu upgrade de velocidad totalmente gratis!','<p class=\"text-gray-800 text-base leading-relaxed py-1\">Hola ?,<br>Tu línea ha sido seleccionada para recibir una <strong>mejora de velocidad sin costo adicional</strong>.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Incluye:<br>✨ Aumento inmediato de megas<br>✨ Sin cambios en tu tarifa actual<br>✨ Sin penalidades</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Solo necesitamos tu confirmación para activarlo.</p>','Quiero mi upgrade gratuito','http://localhost:3000/encuesta/13','2025-12-05 22:53:44','2025-12-06 00:16:29'),(17,72,43,11,1,5,'Alta','Conecta Más – Planes en Promo 2025','Campaña enfocada en captar nuevos clientes ofreciendo planes móviles con descuentos exclusivos por tiempo limitado. Se resaltará la alta cobertura, la velocidad de internet y beneficios extras como redes sociales ilimitadas.','Promoción limitada de planes móviles con mayor velocidad y más gigas por menor precio.','2025-12-06 01:36:00','2025-12-06 02:37:00','? ¡Solo por hoy! Duplica tus gigas y paga menos ?','<p class=\"text-gray-800 text-base leading-relaxed py-1\">Hola ?,</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Sabemos que estar conectado es parte esencial de tu día. Por eso, hemos creado una promoción especial solo por tiempo limitado:</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">✨ <strong>Plan Conecta+ 30 GB → ahora 60 GB</strong><br>✨ Incluye WhatsApp, Instagram y Facebook ilimitados<br>✨ Sin costo de activación<br>✨ Instalación en menos de 24 horas</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">? Ideal para estudiar, trabajar, navegar y jugar sin preocuparte por los megas.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Y lo mejor… desde <strong>S/39 al mes</strong>.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">? Promoción válida solo por esta semana.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">¿Te lo vas a perder?</p>','¡Quiero duplicar mis gigas! ?','http://localhost:3000/encuesta/11','2025-12-06 01:33:40','2025-12-06 02:37:45'),(18,73,43,10,1,4,'Baja','Fibra Turbo Hogar 2025','Internet hogar a mayor velocidad con instalación inmediata.','Internet hogar a mayor velocidad con instalación inmediata.','2025-12-06 04:58:00','2025-12-08 04:55:00',NULL,NULL,NULL,'http://localhost:3000/encuesta/10','2025-12-06 04:55:42','2025-12-06 04:59:33'),(19,74,43,4,1,3,'Media','Hogar Conectado Smart','Paquete basado en fibra + televisor incluido financiado, por motivo navideño o verano.','Venta cruzada: Internet + Smart TV + instalación.','2025-12-06 05:04:00','2025-12-07 05:00:00','? Internet + Smart TV incluido desde S/79/mes ?','<p class=\"text-gray-800 text-base leading-relaxed py-1\">Hola,<br>Llévate hoy tu <strong>Plan Hogar Conectado Smart</strong>:</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">✔ Fibra óptica 400 Mbps<br>✔ Smart TV 32” o 50”<br>✔ Instalación inmediata<br>✔ Financiado sin intereses</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Ideal para streaming, gaming y estudiar desde casa.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Oferta limitada hasta agotar stock.</p>','? “Quiero mi combo Smart”','http://localhost:3000/encuesta/4','2025-12-06 05:01:11','2025-12-06 05:04:50'),(20,76,43,11,1,6,'Media','Recarga Doble Power','Promoción corta por fin de semana con doble saldo y minutos ilimitados.','Recarga móvil y duplicado de saldo.','2025-12-06 06:00:00','2025-12-08 05:57:00','? Recarga S/10 y recibe S/20, SOLO HOY ?','<p class=\"text-gray-800 text-base leading-relaxed py-1\">¡Aprovecha Domingo Power!<br>Recarga desde S/10 y recibe el doble en saldo.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">? Además incluye<br>✔ Minutos ilimitados<br>✔ Redes ilimitadas<br>✔ Vigencia extendida</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Recarga desde la app, agentes o banca móvil.</p>','? “Recargar ahora”','http://localhost:3000/encuesta/11','2025-12-06 05:58:10','2025-12-06 06:31:10'),(21,82,43,4,1,3,'Baja','Full Streaming Sin Cortes','Campaña dirigida a personas que consumen Netflix, YouTube, Disney+ o Twitch, especialmente familias.','Planes optimizados para plataformas de streaming.','2025-12-06 06:42:00','2025-12-10 06:39:00','? Mira streaming sin pausas: fibra desde S/49 ?','<p class=\"text-gray-800 text-base leading-relaxed py-1\">Hola,<br>¿Te detiene el cargando mientras ves tus series?<br>Con nuestro plan <strong>Full Streaming</strong> disfrutas:</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">✔ Velocidad real sin microcortes<br>✔ WiFi amplificado<br>✔ Instalación el mismo día<br>✔ Prioridad para dispositivos Smart TV</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Ahora puedes maratonear sin interrupciones.</p>','? “Quiero ver sin cortes”','http://localhost:3000/encuesta/4','2025-12-06 06:39:47','2025-12-06 06:42:23'),(22,83,43,13,1,3,'Baja','Crear mi pack familiar','Se resalta baja latencia, estabilidad y cobertura WiFi gamer.','Planes enfocados en gamers.','2025-12-06 02:15:00','2025-12-09 07:04:00','? Baja latencia + WiFi gamer = victoria asegurada ?','<p class=\"text-gray-800 text-base leading-relaxed py-1\">Hola gamer,<br>Rompe los retrasos en tus partidas con nuestro plan especializado:</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">✔ 500 Mbps simétricos<br>✔ Ping estable &lt; 10 ms<br>✔ Router WiFi Pro<br>✔ Prioridad de tráfico gaming</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Ideal para PC, consola o móvil.</p>','? “Mejorar conexión gaming”','http://localhost:3000/encuesta/13','2025-12-06 07:04:47','2025-12-06 07:14:26'),(23,84,43,2,1,3,'Alta','Revolución Fibra Real','Campaña aspiracional enfocada en migración tecnológica. Se resalta mejora real en velocidad, estabilidad, latencia y experiencia hogar.','Cambio de ADSL o cable coaxial a fibra óptica pura.','2025-12-06 08:02:00','2025-12-08 07:59:00','? Cambia tu internet a fibra real y vive la diferencia desde el 1er día','<p class=\"text-gray-800 text-base leading-relaxed py-1\">Hola,</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Todavía hay quienes creen que tener internet rápido es cuestión de suerte…<br>Lo cierto es que no, es cuestión de tecnología.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">? Con <strong>Fibra Real</strong> experimentas de inmediato:<br>✔ Velocidad constante, no “hasta”<br>✔ Sin microcortes<br>✔ Mejor rendimiento en streaming y videollamadas<br>✔ Mayor alcance WiFi</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Instalamos en solo horas y sin costo de activación.<br>Tu hogar merece tecnología que evoluciona contigo.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Tú solo agenda la fecha, nosotros hacemos el resto.</p>','✨ “Migrar a Fibra Real”','http://localhost:3000/encuesta/2','2025-12-06 08:00:17','2025-12-06 08:05:40'),(24,85,43,10,1,2,'Baja','Plan 5G Power Experience','Servicio enfocado en rendimiento extremo de navegación, descargas rápidas y gaming móvil.','Planes móviles de alta velocidad con cobertura 5G.','2025-12-06 08:17:00','2025-12-09 08:15:00','⚡ Siente el poder del 5G: descargas en segundos y full velocidad','<p class=\"text-gray-800 text-base leading-relaxed py-1\">Hola,</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Ya no se trata de navegar… ahora se trata de experimentar la velocidad en su máximo nivel.</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Con <strong>5G Power Experience</strong> obtén:<br>? Descargas hasta 10X más rápidas<br>? Gaming sin lag<br>? Video HD sin cortes<br>? Cobertura ampliada en zonas urbanas</p><p class=\"text-gray-800 text-base leading-relaxed py-1\">Además