DROP TABLE IF EXISTS `email_metadata`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `email_metadata` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `resend_email_id` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'ID único del email en Resend',
  `id_campana_mailing` int NOT NULL COMMENT 'FK a campanas_mailing (tiene id_agente_asignado)',
  `email_destinatario` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Email del destinatario',
  `id_lead` bigint DEFAULT NULL COMMENT 'FK al lead (puede ser NULL si no se encuentra)',
  `fecha_envio` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Fecha/hora de envío del email',
  PRIMARY KEY (`id`),
  UNIQUE KEY `resend_email_id` (`resend_email_id`),
  UNIQUE KEY `uk_campana_email` (`id_campana_mailing`,`email_destinatario`),
  KEY `idx_resend_email_id` (`resend_email_id`),
  KEY `idx_campana_email` (`id_campana_mailing`,`email_destinatario`),
  KEY `idx_campana_mailing` (`id_campana_mailing`),
  KEY `idx_fecha_envio` (`fecha_envio`),
  CONSTRAINT `fk_email_metadata_campana` FOREIGN KEY (`id_campana_mailing`) REFERENCES `campanas_mailing` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Mapeo de email_id de Resend con metadata interna. id_agente_asignado se obtiene via JOIN con campanas_mailing';
/*!40101 SET character_set_client = @saved_cs_client */;

