--
-- Table structure for table `historial_estado_lead`
--

DROP TABLE IF EXISTS `historial_estado_lead`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `historial_estado_lead` (
  `historial_id` bigint NOT NULL AUTO_INCREMENT,
  `lead_id` bigint NOT NULL,
  `estado_anterior_id` int DEFAULT NULL COMMENT 'Nulo si es el primer estado (NUEVO)',
  `estado_nuevo_id` int NOT NULL,
  `fecha_cambio` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `usuario_id` bigint DEFAULT NULL COMMENT 'ID del agente/usuario que hizo el cambio (NULL si es sistema)',
  `motivo` varchar(255) DEFAULT NULL,
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`historial_id`),
  KEY `fk_histlead_estado_ant` (`estado_anterior_id`),
  KEY `idx_hist_estado_nuevo` (`estado_nuevo_id`),
  KEY `idx_historial_lead_id` (`lead_id`),
  CONSTRAINT `fk_histlead_estado_ant` FOREIGN KEY (`estado_anterior_id`) REFERENCES `estados_lead` (`estado_lead_id`),
  CONSTRAINT `fk_histlead_estado_nuevo` FOREIGN KEY (`estado_nuevo_id`) REFERENCES `estados_lead` (`estado_lead_id`),
  CONSTRAINT `fk_histlead_lead` FOREIGN KEY (`lead_id`) REFERENCES `leads` (`lead_id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=249 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Log de auditoría de cambios de estado del lead';
/*!40101 SET character_set_client = @saved_cs_client */;

